import React from "react";
import "../stylesheets/animation.css";

const animation = (props) => {
  let animationPaths = ["home/index.html", "Fighter/index.html"];

  return (
    <div
      className={props.popOut === 1 ? "ANOuterDiv popOutRight" : "ANOuterDiv"}
    >
      <iframe
        className={props.popOut === 1 ? "Animation popOutRight" : "Animation"}
        id="HomeAnimation"
        src="home/index.html"
        height="650px"
        width="800px"
        frameBorder="0"
      ></iframe>
    </div>
  );
};

export default animation;
